import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row} from 'react-bootstrap';


const Home = () => {
    const SideBar = (props) => {
        return (
            <div className='side-bar'>
                <p>Side bar tab</p>
            </div>
        )
    }
    return (
        <div>
                <Row>
                    <Col md={3}><SideBar/></Col>
                    <Col md={8}>Main content</Col>
                </Row>
        </div>
    );
};

export default Home;
